		// Dispose 清理缓存状态，主要是一些数据标记，不清理注册的各种回调逻辑
	    // - 已加载的数据
	    // - ab fallback逻辑
		public static void Dispose() 
		{
			foreach(KeyValuePair <string,Action> entry in Disposers) {
				entry.Value();
			}
			// 直接替换 _current，旧实例会被 GC 自动回收
			Interlocked.Exchange(ref _current, new ConfManager());
		}

