		public static void referenceUpdateWithInstance(Dictionary<string, object> ctx, ConfManager cmInstance){
			// 更新 reference 数据，由于ref 属于字段级，进行指针级赋值，所以这里并不关心依赖的顺序
			ctx ??= new Dictionary<string, object>();
			foreach(var item in ReferenceUpdate) {
				item.Value(ctx,cmInstance);
			}
		}

		// 如设定为自动更新(AutoReferenceUpdate),当被引用的数据未加载时会触发lazy加载，可通过RegisterDataStreamProvider支持.
		// 否则在所有数据加载完毕后需手动调佣runReferenceUpdate更新引用关系
		public static void runReferenceUpdate(Dictionary<string, object>? ctx = null){
			ctx ??= new Dictionary<string, object>();
			referenceUpdateWithInstance(ctx,_current);
		}

