        public static string GetOriginalName(System.Enum value)
        {
            var field = value.GetType().GetField(value.ToString());
            if (field != null)
            {
				var attribute = System.Attribute.GetCustomAttribute(field, typeof(ProtobufReflection::OriginalNameAttribute));
				if (attribute != null)
				{
					return ((ProtobufReflection::OriginalNameAttribute)(attribute)).Name;
				}
            }
            return value.ToString();
        }

